import React from 'react';
import { Link } from 'react-router-dom';
import HeroSection from '../common/HeroSection';
import ServiceCard from '../common/ServiceCard';
import Button from '../common/Button';
import SkygateTravelLogo from '../logos/SkygateTravelLogo';
import TravelFooter from '../layout/TravelFooter';

const TravelPage = () => {
  const services = [
    {
      icon: (
        <svg className="w-8 h-8" fill="none" stroke="currentColor" viewBox="0 0 24 24">
          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M3.055 11H5a2 2 0 012 2v1a2 2 0 002 2 2 2 0 012 2v2.945M8 3.935V5.5A2.5 2.5 0 0010.5 8h.5a2 2 0 012 2 2 2 0 104 0 2 2 0 012-2h1.064M15 20.488V18a2 2 0 012-2h3.064M21 12a9 9 0 11-18 0 9 9 0 0118 0z" />
        </svg>
      ),
      title: "International Travel Planning",
      description: "Comprehensive travel planning services for destinations worldwide. We handle everything from visa applications and flight bookings to accommodation and local transportation arrangements.",
      benefits: ["Visa assistance", "Flight bookings", "Hotel reservations", "Local transportation"]
    },
    {
      icon: (
        <svg className="w-8 h-8" fill="none" stroke="currentColor" viewBox="0 0 24 24">
          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M17.657 16.657L13.414 20.9a1.998 1.998 0 01-2.827 0l-4.244-4.243a8 8 0 1111.314 0z" />
          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M15 11a3 3 0 11-6 0 3 3 0 016 0z" />
        </svg>
      ),
      title: "Destination Management",
      description: "Expert destination management services ensuring seamless experiences at your chosen locations. We provide local guides, cultural insights, and personalized itineraries.",
      benefits: ["Local guides", "Cultural insights", "Personalized itineraries", "24/7 support"]
    },
    {
      icon: (
        <svg className="w-8 h-8" fill="none" stroke="currentColor" viewBox="0 0 24 24">
          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M9 12h6m-6 4h6m2 5H7a2 2 0 01-2-2V5a2 2 0 012-2h5.586a1 1 0 01.707.293l5.414 5.414a1 1 0 01.293.707V19a2 2 0 01-2 2z" />
        </svg>
      ),
      title: "Travel Documentation",
      description: "Complete documentation services including passport applications, visa processing, travel insurance, and health certificates. We ensure all your travel documents are in order.",
      benefits: ["Passport assistance", "Visa processing", "Travel insurance", "Health certificates"]
    },
    {
      icon: (
        <svg className="w-8 h-8" fill="none" stroke="currentColor" viewBox="0 0 24 24">
          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M12 8c-1.657 0-3 .895-3 2s1.343 2 3 2 3 .895 3 2-1.343 2-3 2m0-8c1.11 0 2.08.402 2.599 1M12 8V7m0 1v8m0 0v1m0-1c-1.11 0-2.08-.402-2.599-1" />
        </svg>
      ),
      title: "Budget Travel Solutions",
      description: "Affordable travel packages and budget-friendly options without compromising on quality. We find the best deals and create cost-effective travel experiences.",
      benefits: ["Budget packages", "Best deals", "Cost-effective options", "Quality assurance"]
    },
    {
      icon: (
        <svg className="w-8 h-8" fill="none" stroke="currentColor" viewBox="0 0 24 24">
          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M4.318 6.318a4.5 4.5 0 000 6.364L12 20.364l7.682-7.682a4.5 4.5 0 00-6.364-6.364L12 7.636l-1.318-1.318a4.5 4.5 0 00-6.364 0z" />
        </svg>
      ),
      title: "Luxury Travel Experiences",
      description: "Premium travel experiences with luxury accommodations, private transportation, and exclusive access to attractions. Perfect for special occasions and memorable journeys.",
      benefits: ["Luxury accommodations", "Private transportation", "Exclusive access", "Premium service"]
    },
    {
      icon: (
        <svg className="w-8 h-8" fill="none" stroke="currentColor" viewBox="0 0 24 24">
          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M12 8v4l3 3m6-3a9 9 0 11-18 0 9 9 0 0118 0z" />
        </svg>
      ),
      title: "Emergency Travel Support",
      description: "24/7 emergency support services for travelers. We provide immediate assistance for travel disruptions, medical emergencies, and unexpected situations.",
      benefits: ["24/7 support", "Emergency assistance", "Travel disruptions", "Medical emergencies"]
    }
  ];

  const processSteps = {
    "Consultation & Planning": [
      {
        step: "1",
        title: "Initial Consultation",
        description: "Discuss your travel preferences, budget, and requirements to understand your dream destination and expectations."
      },
      {
        step: "2", 
        title: "Destination Research",
        description: "Conduct thorough research on your chosen destinations, including best times to visit, local attractions, and cultural insights."
      },
      {
        step: "3",
        title: "Itinerary Creation",
        description: "Design a personalized itinerary that balances your interests, budget, and time constraints for the perfect travel experience."
      },
      {
        step: "4",
        title: "Documentation Preparation",
        description: "Handle all necessary travel documents including visas, passports, insurance, and health certificates."
      },
      {
        step: "5",
        title: "Booking & Confirmation",
        description: "Secure all bookings including flights, accommodations, and activities with detailed confirmations and backup plans."
      }
    ],
    "Travel & Support": [
      {
        step: "1",
        title: "Pre-Departure Briefing",
        description: "Comprehensive briefing on your destination, local customs, safety tips, and emergency contact information."
      },
      {
        step: "2",
        title: "Travel Day Support",
        description: "Assistance with check-ins, transfers, and any last-minute changes or requirements during your journey."
      },
      {
        step: "3",
        title: "Destination Arrival",
        description: "Welcome services, local transportation arrangements, and orientation to your accommodation and surroundings."
      },
      {
        step: "4",
        title: "Ongoing Support",
        description: "Continuous support throughout your trip with local contacts, activity recommendations, and assistance as needed."
      },
      {
        step: "5",
        title: "Return & Follow-up",
        description: "Assistance with return travel, feedback collection, and planning for your next adventure."
      }
    ]
  };

  const destinations = [
    {
      icon: (
        <svg className="w-8 h-8" fill="none" stroke="currentColor" viewBox="0 0 24 24">
          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M19 21V5a2 2 0 00-2-2H7a2 2 0 00-2 2v16m14 0h2m-2 0h-5m-9 0H3m2 0h5M9 7h1m-1 4h1m4-4h1m-1 4h1m-5 10v-5a1 1 0 011-1h2a1 1 0 011 1v5m-4 0h4" />
        </svg>
      ),
      title: "Dubai",
      description: "Experience the luxury and innovation of Dubai with its iconic skyscrapers, world-class shopping, and desert adventures."
    },
    {
      icon: (
        <svg className="w-8 h-8" fill="none" stroke="currentColor" viewBox="0 0 24 24">
          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M12 3v1m0 16v1m9-9h-1M4 12H3m15.364 6.364l-.707-.707M6.343 6.343l-.707-.707m12.728 0l-.707.707M6.343 17.657l-.707.707M16 12a4 4 0 11-8 0 4 4 0 018 0z" />
        </svg>
      ),
      title: "Istanbul",
      description: "Discover the rich history and culture of Istanbul, where East meets West in a beautiful blend of traditions and modernity."
    },
    {
      icon: (
        <svg className="w-8 h-8" fill="none" stroke="currentColor" viewBox="0 0 24 24">
          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M4.318 6.318a4.5 4.5 0 000 6.364L12 20.364l7.682-7.682a4.5 4.5 0 00-6.364-6.364L12 7.636l-1.318-1.318a4.5 4.5 0 00-6.364 0z" />
        </svg>
      ),
      title: "Paris",
      description: "Fall in love with the City of Light, its romantic atmosphere, world-famous landmarks, and exquisite cuisine."
    },
    {
      icon: (
        <svg className="w-8 h-8" fill="none" stroke="currentColor" viewBox="0 0 24 24">
          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M12 3v1m0 16v1m9-9h-1M4 12H3m15.364 6.364l-.707-.707M6.343 6.343l-.707-.707m12.728 0l-.707.707M6.343 17.657l-.707.707M16 12a4 4 0 11-8 0 4 4 0 018 0z" />
        </svg>
      ),
      title: "Tokyo",
      description: "Immerse yourself in the vibrant culture of Tokyo, from ancient temples to cutting-edge technology and amazing cuisine."
    },
    {
      icon: (
        <svg className="w-8 h-8" fill="none" stroke="currentColor" viewBox="0 0 24 24">
          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M19 21V5a2 2 0 00-2-2H7a2 2 0 00-2 2v16m14 0h2m-2 0h-5m-9 0H3m2 0h5M9 7h1m-1 4h1m4-4h1m-1 4h1m-5 10v-5a1 1 0 011-1h2a1 1 0 011 1v5m-4 0h4" />
        </svg>
      ),
      title: "New York",
      description: "Experience the energy and excitement of the Big Apple with its iconic landmarks, Broadway shows, and diverse neighborhoods."
    },
    {
      icon: (
        <svg className="w-8 h-8" fill="none" stroke="currentColor" viewBox="0 0 24 24">
          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M12 3v1m0 16v1m9-9h-1M4 12H3m15.364 6.364l-.707-.707M6.343 6.343l-.707-.707m12.728 0l-.707.707M6.343 17.657l-.707.707M16 12a4 4 0 11-8 0 4 4 0 018 0z" />
        </svg>
      ),
      title: "London",
      description: "Explore the historic charm of London with its royal palaces, world-class museums, and vibrant cultural scene."
    }
  ];

  const advantages = [
    {
      icon: (
        <svg className="w-8 h-8" fill="none" stroke="currentColor" viewBox="0 0 24 24">
          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M21 12a9 9 0 01-9 9m9-9a9 9 0 00-9-9m9 9H3m9 9v-9m0-9v9" />
        </svg>
      ),
      title: "Global Network",
      description: "Extensive network of partners and contacts worldwide ensuring seamless travel experiences across all destinations."
    },
    {
      icon: (
        <svg className="w-8 h-8" fill="none" stroke="currentColor" viewBox="0 0 24 24">
          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M9 12l2 2 4-4m6 2a9 9 0 11-18 0 9 9 0 0118 0z" />
        </svg>
      ),
      title: "Expert Planning",
      description: "Professional travel planners with deep knowledge of destinations, local customs, and hidden gems."
    },
    {
      icon: (
        <svg className="w-8 h-8" fill="none" stroke="currentColor" viewBox="0 0 24 24">
          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M12 8v4l3 3m6-3a9 9 0 11-18 0 9 9 0 0118 0z" />
        </svg>
      ),
      title: "24/7 Support",
      description: "Round-the-clock support services ensuring assistance whenever you need it during your travels."
    },
    {
      icon: (
        <svg className="w-8 h-8" fill="none" stroke="currentColor" viewBox="0 0 24 24">
          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M12 8c-1.657 0-3 .895-3 2s1.343 2 3 2 3 .895 3 2-1.343 2-3 2m0-8c1.11 0 2.08.402 2.599 1M12 8V7m0 1v8m0 0v1m0-1c-1.11 0-2.08-.402-2.599-1" />
        </svg>
      ),
      title: "Competitive Pricing",
      description: "Best value for money with transparent pricing and no hidden fees for all our travel services."
    },
    {
      icon: (
        <svg className="w-8 h-8" fill="none" stroke="currentColor" viewBox="0 0 24 24">
          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M9 12l2 2 4-4m5.618-4.016A11.955 11.955 0 0112 2.944a11.955 11.955 0 01-8.618 3.04A12.02 12.02 0 003 9c0 5.591 3.824 10.29 9 11.622 5.176-1.332 9-6.03 9-11.622 0-1.042-.133-2.052-.382-3.016z" />
        </svg>
      ),
      title: "Safety & Security",
      description: "Comprehensive safety measures and security protocols to ensure your peace of mind throughout your journey."
    },
    {
      icon: (
        <svg className="w-8 h-8" fill="none" stroke="currentColor" viewBox="0 0 24 24">
          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M4.318 6.318a4.5 4.5 0 000 6.364L12 20.364l7.682-7.682a4.5 4.5 0 00-6.364-6.364L12 7.636l-1.318-1.318a4.5 4.5 0 00-6.364 0z" />
        </svg>
      ),
      title: "Personalized Service",
      description: "Tailored travel experiences designed specifically for your preferences, interests, and requirements."
    }
  ];

  const resources = [
    {
      icon: (
        <svg className="w-8 h-8" fill="none" stroke="currentColor" viewBox="0 0 24 24">
          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M12 6.253v13m0-13C10.832 5.477 9.246 5 7.5 5S4.168 5.477 3 6.253v13C4.168 18.477 5.754 18 7.5 18s3.332.477 4.5 1.253m0-13C13.168 5.477 14.754 5 16.5 5c1.746 0 3.332.477 4.5 1.253v13C19.832 18.477 18.246 18 16.5 18c-1.746 0-3.332.477-4.5 1.253" />
        </svg>
      ),
      title: "Travel Guides",
      description: "Comprehensive destination guides with insider tips, local recommendations, and cultural insights for memorable experiences."
    },
    {
      icon: (
        <svg className="w-8 h-8" fill="none" stroke="currentColor" viewBox="0 0 24 24">
          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M9 7h6m0 10v-3m-3 3h.01M9 17h.01M9 14h.01M12 14h.01M15 11h.01M12 11h.01M9 11h.01M7 21h10a2 2 0 002-2V5a2 2 0 00-2-2H7a2 2 0 00-2 2v14a2 2 0 002 2z" />
        </svg>
      ),
      title: "Travel Tools",
      description: "Essential travel tools including packing checklists, budget calculators, and itinerary planners to organize your trip."
    },
    {
      icon: (
        <svg className="w-8 h-8" fill="none" stroke="currentColor" viewBox="0 0 24 24">
          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M9 19v-6a2 2 0 00-2-2H5a2 2 0 00-2 2v6a2 2 0 002 2h2a2 2 0 002-2zm0 0V9a2 2 0 012-2h2a2 2 0 012 2v10m-6 0a2 2 0 002 2h2a2 2 0 002-2m0 0V5a2 2 0 012-2h2a2 2 0 012 2v14a2 2 0 01-2 2h-2a2 2 0 01-2-2z" />
        </svg>
      ),
      title: "Travel Reports",
      description: "Latest travel trends, destination updates, and market insights to help you make informed travel decisions."
    }
  ];

  const handleScrollToServices = () => {
    const element = document.getElementById('travel-services');
    if (element) {
      element.scrollIntoView({ behavior: 'smooth' });
    }
  };

  return (
    <div className="min-h-screen">
      {/* Hero Section */}
      <HeroSection
        title="Skygate Travel"
        subtitle="Creating Unforgettable Travel Experiences Worldwide"
        description="Your gateway to extraordinary adventures across the globe. From luxury getaways to budget-friendly explorations, we craft personalized travel experiences that create lasting memories and connect you with the world's most amazing destinations."
        backgroundImage="https://images.unsplash.com/photo-1488646953014-85cb44e25828?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D&auto=format&fit=crop&w=2070&q=80"
        ctaButtons={[
          {
            text: "Our Travel Services",
            onClick: handleScrollToServices,
            variant: "glassmorphism",
            className: "px-12 py-6 text-xl"
          }
        ]}
        branding="travel"
      />

      {/* Our Travel Services */}
      <section id="travel-services" className="py-20 bg-gradient-to-br from-travel-50 via-travel-100/30 to-travel-50 relative overflow-hidden">
        <div className="absolute inset-0 bg-gradient-to-br from-travel-100/20 via-transparent to-travel-200/10"></div>
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 relative z-10">
          <div className="text-center mb-16">
            <h2 className="text-4xl md:text-5xl font-black text-gray-900 mb-6">
              Our Travel Services
            </h2>
            <p className="text-xl text-gray-600 max-w-3xl mx-auto leading-relaxed">
              Comprehensive travel solutions designed to make your journey seamless and memorable. 
              From planning to execution, we handle every aspect of your travel experience with 
              expertise, care, and attention to detail.
            </p>
          </div>

          <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8">
            {services.map((service, index) => (
              <div key={index} className="group relative bg-white/80 backdrop-blur-sm rounded-2xl p-8 border-2 border-travel-200 hover:shadow-floating hover:border-travel-400 transition-all duration-500">
                <div className="absolute inset-0 bg-gradient-to-br from-travel-100/20 via-transparent to-travel-200/10 rounded-2xl opacity-0 group-hover:opacity-15 transition-opacity duration-500"></div>
                <div className="relative z-10">
                  <div className="w-16 h-16 bg-gradient-to-br from-travel-100 to-travel-200 rounded-xl flex items-center justify-center mb-6 group-hover:scale-110 transition-transform duration-500">
                    <div className="text-travel-600">
                      {service.icon}
                    </div>
                  </div>
                  <h3 className="text-xl font-bold text-gray-900 mb-4 group-hover:text-travel-700 transition-colors duration-500">
                    {service.title}
                  </h3>
                  <p className="text-gray-600 mb-6 leading-relaxed">
                    {service.description}
                  </p>
                  <div className="space-y-2">
                    {service.benefits.map((benefit, idx) => (
                      <div key={idx} className="flex items-center text-sm text-gray-500">
                        <svg className="w-4 h-4 text-travel-500 mr-2" fill="currentColor" viewBox="0 0 20 20">
                          <path fillRule="evenodd" d="M16.707 5.293a1 1 0 010 1.414l-8 8a1 1 0 01-1.414 0l-4-4a1 1 0 011.414-1.414L8 12.586l7.293-7.293a1 1 0 011.414 0z" clipRule="evenodd" />
                        </svg>
                        {benefit}
                      </div>
                    ))}
                  </div>
                </div>
              </div>
            ))}
          </div>
        </div>
      </section>

      {/* Our Travel Process */}
      <section className="py-20 bg-gradient-to-br from-travel-100/40 via-travel-50 to-travel-100/30 relative overflow-hidden">
        <div className="absolute inset-0 bg-gradient-to-br from-travel-200/25 via-transparent to-travel-300/20"></div>
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 relative z-10">
          <div className="text-center mb-16">
            <h2 className="text-4xl md:text-5xl font-black text-gray-900 mb-6">
              Our Travel Process
            </h2>
            <p className="text-xl text-gray-600 max-w-3xl mx-auto leading-relaxed">
              A structured approach to creating perfect travel experiences. Our dual-phase process 
              ensures comprehensive planning and seamless execution, from initial consultation 
              to your safe return home.
            </p>
          </div>

          <div className="grid grid-cols-1 lg:grid-cols-2 gap-12">
            {Object.entries(processSteps).map(([title, steps], index) => (
              <div key={index} className="space-y-8">
                <h3 className="text-2xl font-bold text-gray-900 text-center mb-8">
                  {title}
                </h3>
                <div className="space-y-6">
                  {steps.map((step, stepIndex) => (
                    <div key={stepIndex} className="group relative bg-white/80 backdrop-blur-sm rounded-2xl p-6 border-2 border-travel-200 hover:shadow-floating hover:border-travel-400 transition-all duration-500">
                      <div className="absolute inset-0 bg-gradient-to-br from-travel-100/20 via-transparent to-travel-200/10 rounded-2xl opacity-0 group-hover:opacity-15 transition-opacity duration-500"></div>
                      <div className="relative z-10 flex items-start space-x-4">
                        <div className="w-12 h-12 bg-gradient-to-br from-travel-100 to-travel-200 rounded-full flex items-center justify-center flex-shrink-0">
                          <span className="text-travel-600 font-bold text-lg">{step.step}</span>
                        </div>
                        <div className="flex-1">
                          <h4 className="text-lg font-semibold text-gray-900 mb-2">
                            {step.title}
                          </h4>
                          <p className="text-gray-600 leading-relaxed">
                            {step.description}
                          </p>
                        </div>
                      </div>
                    </div>
                  ))}
                </div>
              </div>
            ))}
          </div>
        </div>
      </section>

      {/* Popular Destinations */}
      <section className="py-20 bg-gradient-to-br from-travel-50 via-travel-100/20 to-travel-50 relative overflow-hidden">
